a. That an Award and Order be passed directing the Respondent to pay to the Claimant an amount of Rs. 171627.77 as on 03-04-24 with further interest till realization of the dues;
b. That upon failure to pay the aforesaid amount, the Respondent be ordered and directed to handover the peaceful possession of the vehicle / equipment / asset being VOLKSWAGEN INDIA PVT LTD_VENTO 1.6L MT COMFORTLINE DIESEL 5 SEATER Engine No.: CLN188986, Chassis No.: WVWB12608CT031590, Registration No.: HR03N9697, including the original documents thereto, and in the event of the Respondent’s non-compliance thereof, permit the Claimant to take charge / repossess the said vehicle / equipment / asset and sell / transfer the same and appropriate the sale proceeds to satisfy the amount prayed for hereinabove, and in the event, the sale proceeds fall short of the amount awarded, permit the Claimant to recover the balance sum from the Respondent by enforcing this Award;
c. That pending the hearing and final disposal of the arbitration proceedings, interim and ad-interim reliefs be granted in terms of (b) hereinabove in favour of the Claimant;
d. That the Respondent be directed to pay the costs and legal expenses of the present arbitration proceedings, including the fees of the Ld. Sole Arbitrator, and all other expenses incurred by the Claimant in respect thereof; 
e. For such other and further reliefs as the Ld. Sole Arbitrator may deem fit considering the facts and circumstances of the present case.

